import React from 'react';
import { Link } from 'react-router-dom';

const Sidebar = () => {
  return (
    <div className="w-1/4 h-full bg-gray-800 text-white">
        <div className="text-red-500 text-center">Testing Tailwind CSS</div>

      <nav className="flex flex-col h-full">
        <h1 className="text-2xl font-bold p-4">Notion Clone</h1>
        <Link to="/" className="p-4 hover:bg-gray-700">Home</Link>
        <Link to="/page2" className="p-4 hover:bg-gray-700">TBD</Link>
        <Link to="/page3" className="p-4 hover:bg-gray-700">Page 3</Link>
      </nav>
    </div>
  );
};

export default Sidebar;
